d_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:1014:"十六年前，天下五分，姑苏蓝氏，云梦江氏，清河聂氏，岐山温氏，兰陵金氏共治天下温氏一家独大，其余四家均受其苦。众家青年中，江氏故人之子魏无羡性格开朗，和以雅正闻名的姑苏蓝氏弟子蓝忘机相识并引为知己。一次偶然的机会，二人发现了蓝氏一直以来守护的秘密，二人继承遗志，为苍生消除隐患。但没想到一切的幕后黑手正是温氏家主温若寒。众家不堪其辱，合力讨伐温氏。温氏覆灭后，魏无羡却为保护温氏无辜之人不惜与众家对立，最终被奸人所害酿成大祸，误害师姐江厌离，自己也不知所踪。十六年后，消失已久的魏无羡出现在莫家庄，偶遇故人蓝忘机。莫家庄一桩桩诡异的凶案显得扑朔迷离。随着真相一步步揭开，身处幕后的金光瑶渐渐难以隐藏。最后金光瑶身死，蓝忘机承担起了匡扶天下的使命，而魏无羡不忘初心，最终潇洒世间。";s:13:"vod_play_from";s:48:"dbm3u8$$$gqm3u8$$$zuidam3u8$$$172m3u8$$$subom3u8";s:15:"vod_play_server";s:22:"no$$$no$$$no$$$no$$$no";s:13:"vod_play_note";s:12:"$$$$$$$$$$$$";s:12:"vod_play_url";s:15855:"01$https://dbx3.tyswmp.com/20190627/cWod6Dxo/index.m3u8#02$https://dbx3.tyswmp.com/20190627/l8x85Pgp/index.m3u8#03$https://dbx3.tyswmp.com/20190627/wnykmWAo/index.m3u8#04$https://dbx3.tyswmp.com/20190627/nLQ4Lnuw/index.m3u8#05$https://dbx3.tyswmp.com/20190627/ubCKpoIY/index.m3u8#06$https://dbx3.tyswmp.com/20190627/TkW9OzSS/index.m3u8#07$https://dbx3.tyswmp.com/20190628/7AcjUTlW/index.m3u8#08$https://dbx3.tyswmp.com/20190628/5o9jXmBG/index.m3u8#09$https://dbx3.tyswmp.com/20190701/9B2UNg1Y/index.m3u8#10$https://dbx3.tyswmp.com/20190701/byR7Ttsm/index.m3u8#11$https://dbx3.tyswmp.com/20190702/lxbykd7L/index.m3u8#12$https://dbx3.tyswmp.com/20190702/Hjmgvc02/index.m3u8#13$https://dbx3.tyswmp.com/20190703/YgUT8f3X/index.m3u8#14$https://dbx3.tyswmp.com/20190703/EeiqF7kR/index.m3u8#15$https://dbx5.tyswmp.com/20190708/DioUvajJ/index.m3u8#16$https://dbx5.tyswmp.com/20190708/sf8IMQwK/index.m3u8#17$https://dbx5.tyswmp.com/20190709/AS5lN7KN/index.m3u8#18$https://dbx5.tyswmp.com/20190709/z30uzEYh/index.m3u8#19$https://dbx5.tyswmp.com/20190710/AJao2x3R/index.m3u8#20$https://dbx5.tyswmp.com/20190710/kk6AVAc4/index.m3u8#21$https://dbx5.tyswmp.com/20190715/cMymxoKS/index.m3u8#22$https://dbx5.tyswmp.com/20190715/66sKSfCU/index.m3u8#23$https://dbx5.tyswmp.com/20190716/1a4U3SgB/index.m3u8#24$https://dbx5.tyswmp.com/20190716/1AFtyHgt/index.m3u8#25$https://dbx5.tyswmp.com/20190717/kxqRZnC